import React from "react";

import { NavLink } from "react-router-dom";
//import { CopyToClipboard } from "react-copy-to-clipboard";

import BOG from '../../assets/BOG.jpg'
import FACE from '../../assets/FACE.png'

import "./About.css";

class About extends React.Component {
  componentDidMount() {
    window.scrollTo(0, 0);
  }

  render() {
    return (
      <div className="ContextContainer">

        {/* ---------- */}
        {/* MENU */}
        {/* ---------- */}
        <div className="uk-flex uk-flex-center MenuBar ">
          <NavLink to="/home" activeClassName="ItemSelected">
            <p className="MenuItem">Home</p>
          </NavLink>
          <NavLink to="/about" activeClassName="ItemSelected">
            <p className="MenuItem">About</p>
          </NavLink>
          <NavLink to="/experience" activeClassName="ItemSelected">
            <p className="MenuItem">Experience</p>
          </NavLink>
          <NavLink to="/contact" activeClassName="ItemSelected">
            <p className="MenuItem">Contact</p>
          </NavLink>
        </div>

        <div style={{ height: "2vh" }}>&nbsp;</div>


        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div className="BaseCard" style={{backgroundImage: 'url('+ BOG +')'}}>
            <h1 id="CardName">about</h1>


            <div className="uk-child-width-1-2@m" data-uk-grid>
              <div>&nbsp;</div>

              <div>
                <div class="uk-card uk-card-default">
                  <div class="uk-card-media-top uk-flex uk-flex-center" style={{paddingTop: '2em'}}>
                      <img src={FACE} alt="Animoji Face" />
                  </div>
                  <div class="uk-card-body">
                      <h3 class="uk-card-title">Media Top</h3>
                      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt.</p>
                  </div>
                </div>
              </div>


          </div>



          </div>
        </div>





        <div style={{ height: "10vh" }}>&nbsp;</div>
      </div>
    );
  }
}

export default About;
